import React, { Component } from 'react';
import profile from 'images/download.jpg';

class Collectionitem extends Component {
  constructor(props) {
    super(props)
    this.state = {
         agents: this.props.data.Agent,
         id:this.props.data.id
     
      }
  }
  render() {
    
    return (
       <li class="collection-item avatar">
          <img src={profile} alt="" class="circle"></img>
              <span class="title">{this.state.id}</span>
            <p>{this.state.agents} 
            </p>
        <a href="#!" class="secondary-content"><i class="material-icons">grade</i></a>
          <Link to={{pathname: '/Agent',state: {title: this.state.title,userId:this.state.userId,agents:this.state.agents} }}><button class="btn waves-effect waves-light" type="submit" name="action">Show More</button></Link><div class="card-content"></div>
      </li>
    
    );
  }
}

export default Collectionitem;
